import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
    width: 868px;
    margin: 142px auto 50px;
`

const Title = styled.div`
    font-weight: 900;
    width: 868px;
    height: 297px;
    font-size: 48px;
    line-height: 58px;
    color: #001424;
`

export const DesktopSlider = () => {
    return <Wrapper>
        <Title>

        </Title>
    </Wrapper>
}
